import React from 'react';
import './Auth.css'; // Import the shared CSS file

const Register = () => {
  return (
    <div className="form-container">
        <button type="submit" className="btn btn-danger w-100 p-3 mt-3">
            Login
          </button>
          <button type="submit" className="btn btn-danger w-100 p-3 mt-3">
            Register
          </button>
    </div>
  );
};

export default Register;
